import React, { useEffect, useState } from 'react';
import { supabase } from '../supabaseClient';
import { ShoppingBag, ChevronRight, User, CreditCard, Package, MessageCircle } from 'lucide-react';
import { Link } from 'react-router-dom';

const BRAND_BLUE = '#008ECC';

const HomePage = ({ addToCart }) => {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);

  const categories = ["Electronics", "Smartphones", "Laptops", "Watches", "Audio", "Gaming", "Cameras", "Accessories"];

  useEffect(() => { fetchProducts(); }, []);

  const fetchProducts = async () => {
    const { data, error } = await supabase.from('products').select('*').limit(10);
    if (!error) setProducts(data);
    setLoading(false);
  };

  return (
    <div style={{ backgroundColor: '#f5f5f5', minHeight: '100vh' }}>
      {/* LOCAL SUB-NAV: This is the ONLY blue line visible */}
      <nav style={subNavBar}>
        <div style={navItemActive}>
           <ShoppingBag size={18} /> Shop by Category
        </div>
        <Link to="/about" style={navLink}><div style={navText}>About us</div></Link>
        <div style={navText}>Business partnership</div>
        <div style={navText}>Contact us</div>
      </nav>

      <div style={heroGrid}>
        {/* Category Sidebar */}
        <aside style={sidebar}>
          {categories.map((cat, i) => (
            <div key={i} style={sidebarItem}>
              {cat} <ChevronRight size={14} color="#ccc" />
            </div>
          ))}
        </aside>

        {/* Banner */}
        <div style={mainBanner}>
          <div style={bannerContent}>
            <h2 style={bannerTitle}>Wholesale Market</h2>
            <button style={bannerBtn}>GO SHOPPING <ChevronRight size={16} /></button>
          </div>
        </div>

        {/* Profile Card */}
        <div style={profileCard}>
          <div style={avatarSection}>
            <div style={avatarCircle}><User size={24} color="#666" /></div>
            <p style={{fontWeight: '700', fontSize: '14px'}}>Hi, Guest</p>
          </div>
          <div style={userActions}>
             <div style={actionItem}><CreditCard size={18} color={BRAND_BLUE} /><span style={actionLabel}>Coupons</span></div>
             <div style={actionItem}><Package size={18} color={BRAND_BLUE} /><span style={actionLabel}>Orders</span></div>
             <div style={actionItem}><MessageCircle size={18} color={BRAND_BLUE} /><span style={actionLabel}>Support</span></div>
          </div>
          <div style={promoBox}>
            <p style={promoText}><strong>Great Value</strong><br/>Continuous promotions</p>
            <p style={promoText}><strong>Global Delivery</strong><br/>Shipping available</p>
          </div>
        </div>
      </div>

      {/* Product Section */}
      <div style={{ padding: '20px 8%' }}>
        <h2 style={{ fontSize: '20px', fontWeight: '700', marginBottom: '20px' }}>Featured Products</h2>
        {loading ? <p>Loading...</p> : (
          <div style={productGrid}>
            {products.map((p) => (
              <div key={p.id} style={productCard}>
                <div style={imgBox}><img src={p.image_url} alt="" style={prodImg} /></div>
                <div style={{ padding: '12px' }}>
                  <p style={prodName}>{p.name}</p>
                  <p style={prodPrice}>RWF {p.price?.toLocaleString()}</p>
                  <button onClick={() => addToCart(p)} style={addBtn}>Add to Cart</button>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

// --- STYLES ---
const subNavBar = { display: 'flex', gap: '30px', padding: '0 8%', backgroundColor: '#fff', borderBottom: `2px solid ${BRAND_BLUE}`, height: '50px', alignItems: 'center' };
const navItemActive = { backgroundColor: BRAND_BLUE, color: '#fff', height: '100%', padding: '0 25px', display: 'flex', alignItems: 'center', gap: '10px', fontWeight: '700' };
const navText = { color: '#333', fontSize: '14px', fontWeight: '500', cursor: 'pointer' };
const navLink = { textDecoration: 'none' };
const heroGrid = { display: 'grid', gridTemplateColumns: '220px 1fr 240px', gap: '15px', padding: '15px 8%', height: '420px' };
const sidebar = { backgroundColor: '#fff', border: '1px solid #eee', borderRadius: '4px' };
const sidebarItem = { padding: '10px 20px', fontSize: '13px', display: 'flex', justifyContent: 'space-between', borderBottom: '1px solid #f9f9f9', cursor: 'pointer' };
const mainBanner = { backgroundImage: 'url("https://images.unsplash.com/photo-1498050108023-c5249f4df085?w=800")', backgroundSize: 'cover', borderRadius: '4px', position: 'relative' };
const bannerContent = { position: 'absolute', bottom: '40px', left: '40px', color: '#fff' };
const bannerTitle = { fontSize: '36px', fontWeight: '900', margin: '0 0 15px 0' };
const bannerBtn = { backgroundColor: '#000', color: '#fff', border: 'none', padding: '10px 20px', borderRadius: '20px', fontWeight: '700', cursor: 'pointer' };
const profileCard = { backgroundColor: '#fff', padding: '20px', border: '1px solid #eee', borderRadius: '4px', textAlign: 'center' };
const avatarCircle = { width: '45px', height: '45px', borderRadius: '50%', backgroundColor: '#f0f0f0', display: 'flex', alignItems: 'center', justifyContent: 'center', margin: '0 auto 10px' };
const userActions = { display: 'flex', justifyContent: 'space-around', margin: '20px 0' };
const actionLabel = { fontSize: '10px', display: 'block', color: '#666' };
const promoBox = { borderTop: '1px solid #eee', paddingTop: '15px', textAlign: 'left' };
const promoText = { fontSize: '11px', color: '#888', marginBottom: '8px' };
const productGrid = { display: 'grid', gridTemplateColumns: 'repeat(5, 1fr)', gap: '15px' };
const productCard = { backgroundColor: '#fff', borderRadius: '4px', border: '1px solid #eee', overflow: 'hidden' };
const imgBox = { height: '160px', padding: '10px', display: 'flex', alignItems: 'center', justifyContent: 'center' };
const prodImg = { maxWidth: '100%', maxHeight: '100%', objectFit: 'contain' };
const prodName = { fontSize: '13px', height: '36px', overflow: 'hidden', margin: '0 0 8px 0' };
const prodPrice = { fontSize: '15px', fontWeight: '700' };
const addBtn = { width: '100%', padding: '8px', backgroundColor: BRAND_BLUE, color: '#fff', border: 'none', borderRadius: '4px', cursor: 'pointer', fontWeight: '700', marginTop: '10px' };

export default HomePage;
